import React from "react";
import './Navbar.css';

function Navbar(props) {
  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="navbar-brand">
          <h1>Todo App</h1>
        </div>
        <div className="navbar-links">
          <ul>
            <li>
            <button onClick={() => props.setShowCreateTodo(!props.showCreateTodo)}>
  {props.showCreateTodo ? "Cancel" : "Add Todo"}
</button>
            </li>
            <li>
              <button onClick={props.onViewTodos}>View Todos</button>
            </li>
            <li>
              <button onClick={props.onLogout}>Logout</button>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
